import React from 'react';
import Todo from './Todo';

function ToDoList({todos,setTodos}) {
    console.log(todos);
    return (
        <div className="todo-container">
            <ul className="todo-list">
                {todos.map(todo => (
                    <Todo setTodos={setTodos} text={todo.text} key={todo.id}/>
                ))}
            </ul>
        </div>
    )
}

export default ToDoList
